(41, 'Hola!\r\nSe están corrigiendo problemas del Sistema.\r\nPara los profes hemos detectado que el Alumnos, sí seleccionas ver todos, te va a traer Alumnos de años anteriores. También en Seguimientos, el combo de Clases va a traer clases de otros años. Como alternativa se sugiere usar la opción "Clases del día" para agilizar el uso.\r\nSe agregó una funcionalidad que permite agregar un fondo de pantalla tu perfil. Para ello, hacés clic en tu usuario (esquina superior derecha), pestaña "cambiar fondo" y luego elegís la imagen (haciendo clic sobre el nombre).\r\n\r\nSaludos,\r\n\r\nNicolás.\r\n\r\n', 8, 7, 0, 1, '2018-03-01 10:14:11'),
