(56, 'Hola Nico. Te acordas que habiamos  hablado una modificacion del sistema que me dijiste que estaba hecha. Acabo de abrir el sistema y no puedo cargar la planilla completa cuando quiero ir  a los dias anteriores para cargar los datos. Me salen por separado los horarios. Capaz que no se donde esta la funcion que hace eso. Pero,  si tengo que buscar item por item de horario y fecha se hace mas engorrosa la carga. Queria saber si existe la posibilidad de que la presentacion de los dias ya pasados a cargar, fuera identica a la de "clases del dia" o sea, que aparezca la fecha de la clase pasada , con el orden de las clases diarias de esa fecha a cargar. Estaria genial. Abrazo', 11, 7, 0, 0, '2018-03-02 16:05:57'),
